CREATE DEFINER=`root`@`localhost` FUNCTION `new_session_id`() RETURNS int(11)
BEGIN
SELECT CASE WHEN ISNULL(MAX(SessionID)) THEN 1 ELSE MAX(SessionID) + 1 END INTO @max_id FROM active_sessions;
RETURN @max_id;
END ;;
